import Grid from "@mui/material/Grid";
import Divider from "@mui/material/Divider";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import Header from "layouts/profile/components/Header";
import MDButton from "components/MDButton";
import { useState, useEffect } from "react";
import e from "express";

function Overview() {
  const [data, setData] = useState([]);
  const [isEditMode, setIsEditMode] = useState(false);

  const handleEditClick = () => {
    setIsEditMode(!isEditMode);
  };
  const handleSaveClick = async () => {
    try {
      const response = await fetch(`http://localhost:5001/saveProfileData`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data[0]), // Assuming data[0] contains the updated profile data
      });
      // Handle response if needed
      console.log("Data saved successfully");
    } catch (error) {
      console.error("Error saving profile data:", error);
    }
  };

  useEffect(() => {
    const profileFetch = async () => {
      try {
        const response = await fetch(`http://localhost:5001/profileData`);
        const result = await response.json();
        setData(result);
        console.log(result);
      } catch (error) {
        console.error("Error fetching test data:", error);
      }
    };
    profileFetch();
  }, []); // Empty dependency array to fetch data only once on component mount

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <Header title="Profile" subtitle="Manage your profile settings" />
      <Box p={3}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Box sx={{ display: "flex", alignItems: "center" }}>
              <Divider orientation="vertical" flexItem />
              <Box ml={2}>
                <TextField
                  fullWidth
                  id="phone"
                  label="ID"
                  disabled={!isEditMode}
                  variant="outlined"
                  onChange={{...data,ID:e.target.value}}
                  value={data[0]?.ID || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="doj"
                  label="Date of joining"
                  disabled={!isEditMode}
                  variant="outlined"
                  value={data[0]?.doj || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="phone"
                  label="Date of Birth"
                  disabled={!isEditMode}
                  variant="outlined"
                  value={data[0]?.dob || ""}

                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="phone"
                  label="Phone No."
                  disabled={!isEditMode}
                  variant="outlined"
                  value={data[0]?.phone || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="phone"
                  label="Email"
                  disabled={!isEditMode}
                  variant="outlined"
                  value={data[0]?.email || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="address"
                  disabled={!isEditMode}
                  multiline
                  rows={4}
                  label="Address"
                  variant="outlined"
                  value={data[0]?.address || ""}
                  sx={{ marginBottom: "20px" }}
                />
              </Box>
            </Box>
            <Box sx={{ marginLeft: '600px' }}>
              {isEditMode ? (
                <MDButton color="info" onClick={handleSaveClick}>Save</MDButton>
              ) : (
                <MDButton color="info" onClick={handleEditClick}>Edit</MDButton>
              )}
            </Box>
          </Grid>
        </Grid>
      </Box>
      <Footer />
    </DashboardLayout>
  );
}

export default Overview;
